  input: TEXT,F3N,,"In regards to the In-Kind Receipt from the American Academy of
    Otolaryngology of $2447.18, when this was entered into FECfile as an In-kind Receipt,
    it did not automatically generate an In-kind expense.  I tried to delete the entry
    and re-enter it, and kept running into run-time errors and the program would crash.  I
    could not change this entry in any way, to include the election year.  I created
    an expenditure to match the receipt, but was not permitted to check the In-Kind
    box.  I have spoken with Camela twice on this situation, and she indicated that
    I should send the report with this memo to explain the incorrect year that I am
    unable to change.  Thank you."
